import './admin.css'
import { Route, Switch } from 'react-router-dom'

const AdminHome = lazy(() => import('./AdminHome/AdminHome'))
const AdminLogs = lazy(() => import('./AdminLogs/AdminLogs'))
const AdminCompanies = lazy(() => import('./AdminCompanies/AdminCompanies'))
const AdminCustomers = lazy(() => import('./AdminCustomers/AdminCustomers'))
const ViewCoupons = lazy(() => import('../view/ViewCoupons'))

export default function Admin() {

    const getContent = () => {
        return (
            <Suspense fallback={<div className='loading-div'></div>}>
                <Switch>
                    <Route path='/admin/home'>
                        <AdminHome />
                    </Route>
                    <Route path='/admin/customers'>
                        <AdminCustomers />
                    </Route>
                    <Route path='/admin/companies'>
                        <AdminCompanies />
                    </Route>
                    <Route path='/admin/coupons'>
                        <ViewCoupons />
                    </Route>
                    <Route path='/admin/logs'>
                        <AdminLogs />
                    </Route>
                </Switch>
            </Suspense>
        )
    }

    return (<div className='Admin'>
        {getContent()}
    </div>)
}
